    assert(false, isMinusZero(new BigNumber(0).plus(-0)));    //   0 + -0 =  0
    assert(false, isMinusZero(new BigNumber(-0).plus(0)));    //  -0 +  0 =  0
    assert(false, isMinusZero(new BigNumber(0).plus(0)));     //   0 +  0 =  0
    assert(true, isMinusZero(new BigNumber(-0).plus(-0)));    //  -0 + -0 = -0
    assert(false, isMinusZero(new BigNumber(1).plus(-1)));    //   1 + -1 =  0
